const mongoose = require("mongoose");
const Schema = mongoose.Schema;

const UserSchema = new Schema({
  username: {
    type: String,
    required: true,
  },
  email: {
    type: String,
    required: true,
  },
  password: {
    type: String,
    required: true,
  },
  profilePicture: {
    type: String,
    default:
      "data:image/png;base64,",
  },
  connectedAccounts: {
    twitter: {
      type: String,
    },
    facebook: {
      type: String,
    },
    instagram: {
      type: String,
    },
  },
  friends: [
    {
      type: Schema.Types.ObjectId,
      ref: "user",
    },
  ],
  status: {
    type: String,
    default: "online",
  },
  lastStatus: {
    type: String,
    default: null,
  },
  micEnabled: {
    type: Boolean,
    default: false,
  },
  audioEnabled: {
    type: Boolean,
    default: true,
  },
  directMessages: [
    {
      type: Schema.Types.ObjectId,
      ref: "conversation",
    },
  ],
  servers: [
    {
      type: Schema.Types.ObjectId,
      ref: "server",
    },
  ],
});

module.exports = User = mongoose.model("user", UserSchema);
